import React from "react";
import Nav from "./Nav";
import Footer from "./Footer";

const ProjectDetails = ({ match, projectdetail }) => {
  const {
    params: { projectId },
  } = match;

  return (
    <div>
      <Nav />
      <h3>{projectdetail.title}</h3>
      <p>
        <strong>User ID: </strong>
        {projectId}
      </p>
      <p>
        <strong>User Name: </strong>
        {projectdetail[projectId - 1].name}
      </p>
      ); };
      <Footer />
    </div>
  );
};

export default ProjectDetails;
